'The Tortoise and the Hare'

Last Gasp Eco Funnies, 1971, 36 pages

Was to have been Air Pirates #3 before all future issues of Air Pirates were banned as a result of the &quot;Walt Disney Productions vs. The Air Pirates&quot; copyright infringement law suit. 10,000 copies of this comic were confiscated.

